import { useParams } from 'react-router-dom';
import {useGetRepoCollabQuery} from './api';

type Collab = {
  id: number;
  login: string;
  picture_url: string;
};

const Collaborators: React.FC = () => {
  const owner = "facebook";
  const repo = "react";
  const token = "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";

  const {data: collaborators, isLoading} = useGetRepoCollabQuery({owner, repo, token});

  return (
    <div>
      <h2>Collaborators for {owner}/{repo}</h2>
      {/* {error && <p>Error: {error.message}</p>}
